from scipy import special
import numpy as np
import math


def gram_charlier_series(n , x_array , moments_array):
    '''
    Returns a computed array of Gram-Charlier series for an input array of x values.
    
    n: order of the series
    x_array: values of x for which the series is calculated
    moments_array: raw moments of the distribution, 
            i.e. the terms < 1 > = 1, < x >, < x**2 >, ...
    '''
    mu , sigma, standardized_moments = standardize_moments(moments_array)
    
    x_array_std = (x_array-mu)/sigma
    
    return 1/sigma * gram_char(n , x_array_std , standardized_moments)


def edgeworth_series(n , x_array , moments_array):
    '''
    Returns a computed array of Edgeworth series for an input array of x values.
    
    n: order of the series
    x_array: values of x for which the series is calculated
    moments_array: raw moments of the distribution, 
            i.e. the terms < 1 > = 1, < x >, < x**2 >, ...
    '''
    mu , sigma, standardized_moments = standardize_moments(moments_array)
    
    x_array_std = (x_array-mu)/sigma
    
    return 1/sigma * edgeworth(n , x_array_std , standardized_moments)




def Hermite_prob_coeffs(n):
    '''
    Returns the Hermite polynomial coefficients in the order from the lowest to highest, i.e. starting with a constant term.
    '''
    coeffs_phys = np.array(special.hermite(n))
    coeffs_prob = np.zeros(len(coeffs_phys))
    
    for j in range(n+1):
        coeffs_prob[j] = 2**(-n/2) * 2**(-(n-j)/2) * coeffs_phys[j]
        
    return coeffs_prob[::-1]


def coeff_gramchar(n , moments_array): 
    '''
    Returns coefficients for terms in a gram-charlier expansion
    
    moments_array is the array of moments with: 
        - 0th index being 1 
        - 1st index mu1 = 0
        - 2nd index sigma**2 = 1
        - 3rd moment and so on.
        
    It is reqired that the moments_array is longer than n, i.e. enough moments are provided.
    '''
    assert len(moments_array) > n
    
    coeffs_hermite_prob = Hermite_prob_coeffs(n)
    
    coeff_out = 0
    
    for j in range(n+1):
        coeff_out += moments_array[j] * coeffs_hermite_prob[j]
        
    return (-1)**n * coeff_out / math.factorial(n)
    

def evaluate_poly(x ,coeffs):
    n=len(coeffs)-1 #degree of the polynomial
    out = 0
    
    for j in range(n+1):
        out += x**j * coeffs[j]
        
    return out


def evaluate_hermite(n,x):
    coeffs = Hermite_prob_coeffs(n)
    return evaluate_poly(x ,coeffs)


def gram_char(n , x_array , moments_array):
    '''
    moments should be standardized
    '''
    list_hermite_calculated = []
    
    for j in range(n+1):
        coeffs_aux = Hermite_prob_coeffs(j)
        
        hermite_calc_aux = []
        for x in x_array:
            hermite_calc_aux = hermite_calc_aux + [evaluate_poly(x, coeffs_aux)]
            
        list_hermite_calculated = list_hermite_calculated + [np.array(hermite_calc_aux)]
        
    out_array = np.zeros(len(x_array))
    
    for j in range(n+1):
        coeff_gc = coeff_gramchar(j , moments_array)
        out_array += (-1.)**j * coeff_gc * list_hermite_calculated[j]
    
    return 1/(np.sqrt(2*np.pi)) * np.exp(-np.array(x_array)**2/2 ) * np.array(out_array)


def standardize_moments(unnormalized_moments):
    '''
    unnormalized_moments: moments starating with a constant term of 1.
    '''
    mu = unnormalized_moments[1]
    sigma = np.sqrt(unnormalized_moments[2] - mu**2)
    
    standardized_moments = [1,0,1] # a constant, mean, standard deviation
    
    for j in range(3,len(unnormalized_moments)):
        std_mom_aux = 0
        
        for k in range(j+1):
            std_mom_aux += math.comb(j,k) * (-mu)**k * unnormalized_moments[j-k]
            
        standardized_moments += [std_mom_aux/sigma**j]
    
    return mu , sigma, standardized_moments


def edgeworth(n, x_array, standardized_moments):
    assert len(standardized_moments) > n 
    assert  n < 21
    out_array = np.ones(len(x_array))

    for (n_x,x) in enumerate(x_array):
        hermite_array = []
        for j in range(3*(n-2)+1):
            hermite_array += [(-1)**j * evaluate_hermite(j,x)]
            
        for m in range(3,n+1):
            out_array[n_x] += edgeworth_single_term(m, hermite_array , standardized_moments)
        
    
    return 1/(np.sqrt(2*np.pi)) * np.exp(-np.array(x_array)**2/2 ) * np.array(out_array)



